If you have no Spell/Trap Cards in your Graveyard, you can Special Summon this card (from your hand). After this card was Special Summoned this way, you cannot Special Summon monsters for the rest of this turn, except "Superheavy Samurai" monsters. You can Tribute this card, then activate 1 of these effects;
<br> Destroy 1 card in your opponent's Spell & Trap Zone, then you can Set the destroyed Spell/Trap Card on your side of the field.
<br> Destroy 1 card in your opponent's Pendulum Zone, then you can place the destroyed card in your Pendulum Zone.

When an opponent's monster declares an attack: Activate 1 of these effects;
<br> Banish 1 "D/D/D" monster from your Graveyard, and if you do, the attacking monster loses ATK equal to the banished monster's ATK.
<br> Add 1 Level 4 or lower "D/D" Pendulum Monster from your Deck to your hand.

Once per turn, during either player's turn: You can discard 1 "Ninja" monster, then activate 1 of these effects;
<br> This turn, "Ninja" monsters and "Ninjitsu Art" cards you control cannot be destroyed by battle or card effects.
<br> 1 "Ninja" monster you control gains 1000 ATK until the end of this turn.
